import React from 'react'
import Container from 'react-bootstrap/Container';
import Tables from '../Table/Table';
import songsHeader from '../../data'
import songsBio from '../../data'

function home() {
  return (

      <Container>
        <div class="d-flex justify-content-between mt-5 "> 
        <h1 className="font-weight-bold text-secondary">Top 10 Songs</h1>
        <button className="btn btn-secondary">+ Add Song</button>
        </div>
        <Tables heading={songsHeader} columnData={songsBio}/>

      </Container>


  )
}

export default home
